import requests
from bs4 import BeautifulSoup

def getCSACompanies():
    company_names = []
    # Send a GET request to the CSA STAR registry page
    url = "https://cloudsecurityalliance.org/star/registry"
    try:
        response = requests.get(url)

        # Parse the HTML content with BeautifulSoup
        soup = BeautifulSoup(response.text, 'html.parser')

        # List to store company names
        company_names = []

        # Find elements with class "c-card star-registry-card" and extract the data-name attribute
        for card in soup.find_all("div", class_="c-card star-registry-card"):
            company_name = card.get("data-name")
            if company_name:
                company_names.append(company_name.strip())
    except Exception as e:
        print(e)
    finally:
        # Output the list of company names
        return company_names

